INSERT INTO `product` VALUES (1,'Латте',45,'Кава з молоком - відмінний вибір для любителів солодкого та молочного смаку.',1),(2,'Еспрессо',35,'Це короткий, але виразний кавовий напій, який пробуджує інтенсивний смак кави.',1),(3,'Американо',40,'Кава з більшою кількістю води - ідеальна на початок нового дня або для перерви між роботою.',1),(4,'Чизкейк',60,'Сирний десерт з пісочним коржем - смак, який розкривається поступово!',2),(5,'Мафін',30,'Пухкий та смачний мафін з шоколадом - солодкий десерт на будь-який смак!',2),(6,'Тірамісу',70,'Це найкращий спосіб закінчити свій обід. Це італійський десерт, який включає до складу каву та маскарпоне.',2),(7,'Яєчня з беконом',50,'Смачна яєчня з беконом та тостом - ідеальний вибір для сніданку або перекусу!',3),(8,'Овсянка з фруктами',40,'Здоровий та поживний сніданок - наша овсянка з додаванням свіжих фруктів.',3),(9,'Гранола з йогуртом',45,'Гранола - це дуже корисна страва, що складається з сухофруктів, злаків та насіння. Додайте йогурт для насичення смаку!',3),(10,'Цезар з курочкою',90,'Просто смачний цезар. Справді смачний.',4),(11,'Крем-суп з грибів',50,'Теплий та затишний суп з грибів - ідеальний вибір для прохолодної пори року!',4),(12,'Цибульник',40,'Традиційна українська страва - цибульник, з приємним ароматом та чудовим смаком.',4),(13,'Піца Маргарита',80,'Класична піца з томатами, моцареллою та базиліком - смачна та проста!',4),(14,'Салат Цезар',60,'Насичений салат з куркою, запеченим беконом та гарячими грінками - ідеальна закуска до обіду!',5),(15,'Салат з тунцем',70,'Свіжий та легкий салат з тунцем, огірками та помідорами - ідеальний варіант для літньої пори року!',5),(16,'Хот-дог з ковбаскою',50,'Класичний хот-дог з ковбаскою та гірчицею - швидкий та задовільний перекус!',6),(17,'Сендвіч з куркою',60,'Смачний та насичений сендвіч з куркою, томатом та салатом - ідеальний варіант для перекусу на обіді!',6),(18,'Бургер з говядини',90,'Смачний та насичений бургер з говядини, з карамелізованим луком та сиром - ідеальний варіант для голодних!',6),(19,'Шоколадний кекс',35,'Пухкий та шоколадний кекс - ідеальна закуска для любителів солодкого!',7),(20,'Млинці зі сметаною',50,'Традиційна українська страва - млинці зі сметаною, з приємним смаком та ароматом.',7),(21,'Чай з малиною',25,'Теплий та затишний чай з малиною - ідеальний варіант для зігріву в прохолодну пору року!',8),(22,'Кава латте',45,'Ароматна та насичена кава латте з молоком - ідеальний варіант для початку дня!',8),(23,'Кава капучино',40,'Смачна та насичена кава капучино з молоком та корицею - ідеальний варіант для солодкої людини!',8),(24,'Коктейль \"Мохіто\"',70,'Свіжий та легкий коктейль \"Мохіто\" з мятою та лимоном - ідеальний варіант для літнього вечора!',8),(25,'Коктейль \"Маргаріта\"',80,'Ароматний та насичений коктейль \"Маргаріта\" з лаймом та сіллю - ідеальний варіант для вечірнього відпочинку!',8),(26,'Лимонад з малиною',30,'Свіжий та насичений лимонад з малиною - ідеальний варіант для освіження у літню спеку!',8),(27,'Омлет зі шпинатом',60,'Легкий та здоровий омлет зі шпинатом, томатами та сиром - ідеальний варіант для сніданку!',3),(28,'Каша з гарбузом',45,'Смачна та насичена каша з гарбузом та горіхами - ідеальний варіант для здорового сніданку!',3),(29,'Кекс з бананами',35,'Ароматний та смачний кекс з бананами - ідеальна закуска до чаю чи кави!',7);
/*!40000 ALTER TABLE `product` ENABLE KEYS */;
UNLOCK TABLES;

